
import os
import sqlite3
from datetime import datetime
import pandas as pd
import streamlit as st
import matplotlib.pyplot as plt
import seaborn as sns

DB_NAME = 'food_waste.db'
DATA_DIR = 'data'

st.set_page_config(page_title="Local Food Wastage Management System", layout="wide")

# ---------- Utility Functions ----------

def execute_query(query, params=None):
    conn = sqlite3.connect(DB_NAME)
    cursor = conn.cursor()
    if params:
        cursor.execute(query, params)
    else:
        cursor.execute(query)
    results = cursor.fetchall()
    conn.commit()
    conn.close()
    return results

def get_unique_values(table, column):
    try:
        query = f"SELECT DISTINCT {column} FROM {table}"
        results = execute_query(query)
        return [r[0] for r in results]
    except:
        return []

# ---------- Database Setup Functions ----------

def create_database():
    conn = sqlite3.connect(DB_NAME)
    cursor = conn.cursor()
    cursor.execute("""
        CREATE TABLE IF NOT EXISTS Providers (
            Provider_ID INTEGER PRIMARY KEY AUTOINCREMENT,
            Name TEXT,
            Type TEXT
        )
    """)
    cursor.execute("""
        CREATE TABLE IF NOT EXISTS Receivers (
            Receiver_ID INTEGER PRIMARY KEY AUTOINCREMENT,
            Name TEXT,
            Type TEXT
        )
    """)
    cursor.execute("""
        CREATE TABLE IF NOT EXISTS FoodListings (
            Listing_ID INTEGER PRIMARY KEY AUTOINCREMENT,
            Food_Name TEXT,
            Quantity INTEGER,
            Expiry_Date TEXT,
            Provider_ID INTEGER,
            Provider_Type TEXT,
            Location TEXT,
            Food_Type TEXT,
            Meal_Type TEXT
        )
    """)
    cursor.execute("""
        CREATE TABLE IF NOT EXISTS Claims (
            Claim_ID INTEGER PRIMARY KEY AUTOINCREMENT,
            Listing_ID INTEGER,
            Receiver_ID INTEGER,
            Claim_Date TEXT
        )
    """)
    conn.commit()
    conn.close()

